import styles from './Form.module.css';
const Form=()=>{
    return(
        <>
          <div className='form'>
              <div className='two-btn'>
                <button></button>
                <button></button>
              </div>
              <button></button>
              <input type="text" name="name" id="name" />
          </div>
        </>
    )
}
export default Form;
